import React from 'react';
import './index.css';

class App extends React.Component{

    render(){
        return (
            <div className='container'>
            <h3>Your Custom Storage</h3>
            <p>You can max use 4 characters/number for each level's name</p>
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <form class="form-inline my-2 my-lg-0">
                <input class="form-control mr-sm-2" type="search" placeholder="RM1" aria-label="Search" onChange={this.handleChange}/>
                <button class="btn btn-outline-success my-2 my-sm-0" type="submit">ADD</button>
                </form>
            </nav>
            </div>

        )
    }
}
export default App;
